import './App.css';
import Footer from './Components/Footer/Footer';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Inicio from './Pages/Inicio';
import Sneakers from './Pages/Sneakers';
import Marquitas from './Pages/Marcas';
import Cart from './Pages/Cart';
import LoginSignup from './Pages/LoginSignup';
import Change from './Pages/Change';
import RegisterAdmin from './Pages/RegisterAdmin'; 
import Signup from './Pages/Signup'; 
import Pago from './Pages/Pago';
import AgregarProducto from './Pages/AddProduct'; 
import AgregarMarca from './Pages/AddBrand'; 
import EliminarMarca from './Pages/EliminarMarca';
import RecoverPassword from './Pages/RecoverPass';
import Reset from './Pages/ResetPass'
import EliminarUsuario from './Pages/EliminarUsuario';
import EliminarProducto from './Pages/EliminarProducto';
import ProductDetails from './Pages/VistaU';
import { CartProvider } from './Context/CartContext';
import { AuthProvider } from './Context/AuthContext';

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <div className='main-content'>
          <BrowserRouter>
            <Navbar />
            <Routes>
            <Route path='/' element={<Inicio />} />
            <Route path='/sneakers' element={<Sneakers />} />
            <Route path='/marca/:id_marca' element={<Marquitas />} />
            <Route path='/cart' element={<Cart />} />
            <Route path='/login' element={<LoginSignup />} />
            <Route path='/signup' element={<Signup />} />
            <Route path = '/pago' element= {<Pago/>}/>
            <Route path='/product/:id' element={<ProductDetails />} />
            <Route path='/register-admin' element={<RegisterAdmin />} />
            <Route path='/agregar-producto' element={<AgregarProducto />} />
            <Route path='/agregar-marca' element={<AgregarMarca />} />
            <Route path= "/eliminar-marca" element={<EliminarMarca />} />
            <Route path='/recover' element={<RecoverPassword />} /> 
            <Route path= "/eliminar-producto" element={<EliminarProducto />} />
            <Route path="/eliminar-usuario" element={<EliminarUsuario />} />
            <Route path='/reset/:token' element={<Reset />} />
            <Route path='/change' element={<Change />} /> 

            </Routes>
          </BrowserRouter>
          <Footer />
        </div>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
